import React, { useEffect, useState } from 'react';
import './SquarePanel.css';

function SquarePanel() {
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    // Set a timeout to make the title and smaller panel appear after a delay.
    const timeout = setTimeout(() => {
      setIsVisible(true);
    }, 10000); // Adjust the delay time as needed (in milliseconds)

    // Clean up the timeout when the component unmounts.
    return () => clearTimeout(timeout);
  }, []);

  return (
    <div className="square-panel">
      <div className={`title ${isVisible ? 'fade-in' : ''}`}>
        Hello!
      </div>
      <div className={`smaller-panel ${isVisible ? 'fade-in' : ''}`}>
        <p>This is a smaller panel.</p>
        <p>This is a smaller panel.</p>
        <p>This is a smaller panel.</p>
        <p>This is a smaller panel.</p>
        <p>This is a smaller panel.</p>
        <p>This is a smaller panel.</p>
        <p>This is a smaller panel.</p>
      </div>
    </div>
  );
}

export default SquarePanel;
